parser.add_argument(\n        \"--data_dir\", \"-d\", type=str, required=True, help=\"path to directory containing AstroNet segment\"\n    )\n    parser.add_argument(\n        \"--max_frame_lookahead\",\n        \"-l\",\n        type=int,\n        default=5,\n        help=\"maximum number of consecutive frames to consider for matching/co-visibility\",\n    )\n    parser.add_argument(\n        \"--num_workers\",\n        \"-nw\",\n        type=int,\n        default=1,\n        help=\"Number of workers to start (processes, by default)\",\n    )\n    parser.add_argument(\n        \"--threads_per_worker\",\n        \"-th\",\n        type=int,\n        default=1,\n        help=\"Number of threads per each worker\",\n    )\n    parser.add_argument(\n        \"--config_name\",\n        \"-c\",\n        type=str,\n        default=\"deep_front_end.yaml\",\n        help=\"Choose sift_front_end.yaml or deep_front_end.yaml\",\n    )\n    parser.add_argument(\n        \"--scene_mesh_path\",\n        \"-m\",\n        type=str,\n        default=None,\n        help=\"Path to file containing triangular surface mesh of target body.\",\n    )\n    args = parser.parse_args()\n\n    # Initialize SceneOptimizer from config.\n    with hydra.initialize_config_module(config_module=\"gtsfm.configs\"):  # config is relative to the gtsfm module\n        cfg = hydra.compose(config_name=args.config_name)\n    scene_optimizer: SceneOptimizer = instantiate(cfg.SceneOptimizer)\n\n    if args.scene_mesh_path is not None:\n        if not Path(args.scene_mesh_path).exists():\n            raise FileNotFoundError(f\"No mesh found at {args.scene_mesh_path}\")\n        scene_trimesh = trimesh.load(args.scene_mesh_path, process=False, maintain_order=True)\n    else:\n        scene_trimesh = None\n\n    # Initialize loader.\n    loader = AstronetLoader(\n        data_dir=args.data_dir,\n        use_gt_extrinsics=True,\n        use_gt_sfmtracks=False,\n        max_frame_lookahead=args.max_frame_lookahead,\n    )\n\n    # Create Dask task graph.\n    # Note: scene mesh not surrently used by scene_optimizer\n    sfm_result_graph = scene_optimizer.create_computation_graph(\n        num_images=len(loader),\n        image_pair_indices=loader.get_valid_pairs(),\n        image_graph=loader.create_computation_graph_for_images(),\n        camera_intrinsics_graph=loader.create_computation_graph_for_intrinsics(),\n        image_shape_graph=loader.create_computation_graph_for_image_shapes(),\n        gt_pose_graph=loader.create_computation_graph_for_poses(),\n        gt_scene_mesh=scene_trimesh,\n    )\n\n    # Create Dask client.\n    cluster = LocalCluster(n_workers=args.num_workers, threads_per_worker=args.threads_per_worker)\n\n    # Compute SfM solution.\n    with Client(cluster), performance_report(filename=\"dask-report.html\"):\n        sfm_result = sfm_result_graph.compute()\n    assert isinstance(sfm_result, GtsfmData)\n\n        &lt;/pre&gt;\n        "},"id":"1390","type":"Div"},{"attributes":{"fill_color":{"value":"blue"},"height":{"value":0.9},"line_color":{"value":"blue"},"width":{"field":"bandwidth"},"x":{"field":"bandwidth-half"},"y":{"field":"type"}},"id":"1197","type":"Rect"},{"attributes":{"days":[1,8,15,22]},"id":"1520","type":"DaysTicker"},{"attributes":{"source":{"id":"1072"}},"id":"1104","type":"CDSView"},{"attributes":{},"id":"1526","type":"YearsTicker"},{"attributes":{"data_source":{"id":"1072"},"glyph":{"id":"1101"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1104"}},"id":"1103","type":"GlyphRenderer"},{"attributes":{},"id":"1410","type":"DatetimeTickFormatter"},{"attributes":{"source":{"id":"1207"}},"id":"1387","type":"CDSView"},{"attributes":{"child":{"id":"1003"},"title":"Worker Profile (compute)"},"id":"1392","type":"Panel"},{"attributes":{"months":[0,4,8]},"id":"1524","type":"MonthsTicker"},{"attributes":{"follow":"end","follow_interval":20000,"range_padding":0},"id":"1209","type":"DataRange1d"
